It is possible to specify sources separately to keep them up to date semi automatically. The basic rules are specified in pkgs/sources.toml: # nvfetcher.toml
[libinih]
src.github = "benhoyt/inih"
fetch.github = "benhoyt/inih" After changes to this file as well as to update the packages specified in there run nvfetcher (for more details see nvfetcher ). The pkgs overlay is managed in pkgs/default.nix: final: prev: { # keep sources first, this makes sources available to the pkgs sources = prev.callPackage (import ./_sources/generated.nix) { }; # then, call packages with `final.callPackage` libinih = prev.callPackage ./development/libraries/libinih { };
} Lastly the example package is in pkgs/development/libraries/libinih/default.nix: { stdenv, meson, ninja, lib, sources, ... }:
stdenv.mkDerivation { pname = "libinih"; # version will resolve to the latest available on gitub inherit (sources.libinih) version src; buildInputs = [ meson ninja ]; # ...
}

