Previous to nvfetcher it was possible to manage sources via a pkgs/flake.nix, the main changes from there are that sources where in the attribute "srcs" (now "sources") and the contents of the sources where slightly different. In order to switch to the new system, rewrite pkgs/flake.nix to a pkgs/sources.toml file using the documentation of nvfetcher, add the line that calls the sources at the beginning of pkgs/default.nix, and accomodate the small changes in the packages as can be seen from the example. The example package looked like: pkgs/flake.nix: { description = "Package sources"; inputs = { libinih.url = "github:benhoyt/inih/r53"; libinih.flake = false; };
} pkgs/default.nix: final: prev: { # then, call packages with `final.callPackage` libinih = prev.callPackage ./development/libraries/libinih { };
} pkgs/development/libraries/libinih/default.nix: { stdenv, meson, ninja, lib, srcs, ... }:
let inherit (srcs) libinih; in
stdenv.mkDerivation { pname = "libinih"; # version will resolve to 53, as specified in the flake.nix file inherit (libinih) version; src = libinih; buildInputs = [ meson ninja ]; # ...
}

