You will need the agenix command to create secrets. DevOS conveniently provides that in the devShell, so just run nix develop whenever you want to edit secrets. Make sure to always run agenix while in the secrets/ folder, so it can pick up your secrets.nix. To create secrets, simply add lines to your secrets/secrets.nix: let ... allKeys = [ system user ];
in
{ "secret.age".publicKeys = allKeys;
} That would tell agenix to create a secret.age file that is encrypted with the system and user ssh public key. Then go into the secrets folder and run: agenix -e secret.age This will create the secret.age, if it doesn't already exist, and allow you to edit it. If you ever change the publicKeys entry of any secret make sure to rekey the secrets: agenix --rekey

