Once you have your secret file encrypted and ready to use, you can utilize the age module to ensure that your secrets end up in /run/secrets. In any profile that uses a NixOS module that requires a secret you can enable a particular secret like so: { self, ... }:
{ age.secrets.mysecret.file = "${self}/secrets/mysecret.age";
} Then you can just pass the path /run/agenix/mysecret to the module. You can make use of the many options provided by the age module to customize where and how secrets get decrypted. You can learn about them by looking at the age module . Note: You can take a look at the agenix repository for more information about the tool.

